import axios from "axios";
import React, { useEffect, useState } from "react";
import { IMAGE_API_URL, POKEMON_API_URL } from "./api";
import PokemonCard from "./PokemonCard";

function Pokedex() {
  const [pokemon, setPokemon] = useState([]);
  const [loadpage, setLoadPage] = useState([]);
  useEffect(() => {
    axios.get(POKEMON_API_URL).then((res) => {
      res.data.results.forEach(() => {
        const pokemon = axios.get(POKEMON_API_URL + `${pokemon.name}`);
      });
      setPokemon((p) => [...p, pokemon.data]);
    });
  }, []);

  return (
    <div className="row">
      {pokemon ? (
        pokemon.map((pokemon) => <PokemonCard key={pokemon.name} />)
      ) : (
        <h1>Loading Pokemon...</h1>
      )}
    </div>
  );
}

export default Pokedex;
